(1, 1, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2021-08-10 19:26:18', '2021-08-10 19:26:18', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', 'comment', 0, 0),
(2, 57, 'Blanca Conti', 'test@test.com', 'http://www.mywebsite.com', '85.237.175.65', '2016-02-18 19:36:16', '2016-02-18 19:36:16', 'Donec sit amet nibh est. Morbi augue libero, pretium vitae nulla ac, malesuada ultricies neque. Donec eget neque erat. Nam dictum justo sit amet placerat consectetur.', 0, '1', '', 'comment', 0, 0),
(3, 57, 'Monica Donce', 'test@test.com', '', '85.237.175.65', '2016-02-18 19:38:01', '2016-02-18 19:38:01', 'Ut lectus felis, facilisis nec erat at, pretium pellentesque lectus.', 0, '1', '', 'comment', 2, 0),
(4, 57, 'John Smith', 'test@pixelemu.com', '', '212.109.165.124', '2016-02-22 07:15:32', '2016-02-22 07:15:32', 'Aenean mattis, diam ut consectetur condimentum, urna quam dictum metus, ac hendrerit arcu tellus consequat nibh. Phasellus eu tincidunt mi. Maecenas in consequat felis, ac finibus turpis. Donec malesuada at lorem et euismod. Donec lorem libero, gravida vel arcu eget, accumsan tempor urna. Suspendisse porta in nunc ac tempus. In fringilla laoreet nisi ut lacinia. Maecenas condimentum sapien et venenatis porttitor. Vestibulum tincidunt feugiat aliquam.', 0, '1', '', 'comment', 0, 0),
(5, 57, 'John Smith', 'test@pixelemu.com', '', '212.109.165.124', '2016-02-22 07:51:02', '2016-02-22 07:51:02', 'Vivamus rutrum augue a leo rhoncus, non laoreet mi aliquam. Proin nec tincidunt mauris. Vestibulum vestibulum blandit ipsum quis vestibulum. Donec rhoncus suscipit diam, varius sagittis ipsum suscipit sed. Vivamus id metus diam. Nullam et iaculis ligula. Sed imperdiet suscipit est et cursus.\n\nVivamus rutrum augue a leo rhoncus, non laoreet mi aliquam. Proin nec tincidunt mauris. Vestibulum vestibulum blandit ipsum quis vestibulum. Donec rhoncus suscipit diam, varius sagittis ipsum suscipit sed.', 0, '1', '', 'comment', 0, 0),
(6, 57, 'Pixel Emu', 'info@pixelemu.com', 'http://www.pixelemu.com', '212.109.165.124', '2016-09-29 06:49:10', '2016-09-29 06:49:10', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus sed mi sed felis porttitor malesuada quis sed nibh. Suspendisse faucibus enim et purus fringilla, ac placerat risus egestas. In aliquam augue vitae luctus semper. Morbi nec enim diam. Donec eget risus sed sapien vestibulum aliquet. Nulla molestie ultricies sem maximus venenatis. Nulla scelerisque rhoncus ipsum, eget convallis sapien varius quis.', 0, '1', '', 'comment', 3, 0),
(7, 57, 'Pixel Emu', 'info@pixelemu.com', 'http://www.pixelemu.com', '212.109.165.124', '2016-09-29 06:49:20', '2016-09-29 06:49:20', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus sed mi sed felis porttitor malesuada quis sed nibh. Suspendisse faucibus enim et purus fringilla, ac placerat risus egestas. In aliquam augue vitae luctus semper. Morbi nec enim diam. Donec eget risus sed sapien vestibulum aliquet. Nulla molestie ultricies sem maximus venenatis. Nulla scelerisque rhoncus ipsum, eget convallis sapien varius quis.', 0, '1', '', 'comment', 6, 0),
(8, 1392, 'admin', 'artur.kaczmarek@design-joomla.eu', '', '::1', '2017-03-28 07:28:40', '2017-03-28 07:28:40', 'Nullam eros nulla, sodales ut pharetra quis, luctus consectetur risus. In hac habitasse platea dictumst. Aenean semper ipsum at mauris varius rhoncus. Sed ut posuere arcu. Praesent convallis porttitor metus, et fermentum turpis fringilla ac. Integer eleifend eleifend enim ac ultrices. Maecenas id leo et libero sodales pharetra. Nunc ac faucibus elit. Aliquam est erat, consectetur eget egestas sed, sodales ac purus.', 0, '1', '', 'comment', 0, 0),
(9, 1392, 'admin', 'artur.kaczmarek@design-joomla.eu', '', '::1', '2017-03-28 07:29:13', '2017-03-28 07:29:13', 'Pellentesque imperdiet malesuada posuere. Fusce ultrices diam non mauris lobortis suscipit. Sed rhoncus sapien ac nibh hendrerit tincidunt. Praesent et ullamcorper turpis. Cras vestibulum dolor turpis, vel pharetra turpis elementum ac. Phasellus justo lacus, pretium vel molestie eget, sollicitudin at sem. Nulla in quam ut nisi eleifend interdum eget eu ligula. Donec in faucibus magna. In vestibulum tortor vel purus tempor rhoncus. Sed et quam elementum leo pharetra luctus. Lorem ipsum dolor sit amet, consectetur adipiscing elit.', 0, '1', '', 'comment', 8, 0);
