strong></p>\n[code][anibox effect=\"sadie\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"sadie\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 1\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div>\n<div class=\"col-md-6\">\n<p><strong>Example 2</strong></p>\n[code][anibox effect=\"goliath\" background=\"http://placehold.it/480x360\"  fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"goliath\" background=\"http://placehold.it/480x360\"  fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 2\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div></div>\n<div class=\"row\"><div class=\"col-md-6\">\n<p><strong>Example 3</strong></p>\n[code][anibox effect=\"julia\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"julia\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 3\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div>\n<div class=\"col-md-6\">\n<p><strong>Example 4</strong></p>\n[code][anibox effect=\"marley\" background=\"http://placehold.it/480x360\" fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"marley\" background=\"http://placehold.it/480x360\" fontcolor=\"#ffffff\" width=\"480\" he