(370, 1, '2015-09-22 10:10:40', '2015-09-22 10:10:40', '[gallery columns=\"1\" link=\"none\" size=\"full\" id=\"2827\" ids=\"2827\"]\nYou can make your WordPress! website unavailable to visitors until selected date. To enable this option login to Admin section.\n\n1. Click the <strong>Theme Options </strong>on admin menu.\n\n2. Scroll at the end of <strong>Basic Settings</strong>\n\n2. Find field <strong>Coming Soon</strong> and click the <strong>ON / OFF</strong> button to enable or disable.\n\n3. Next set date in filed <strong>Coming Soon Date</strong>.\n\nClick the Save button to implement the new settings.\n\nNote: The Coming Soon will not be available if you are logged in as admin in your site, you will have to log-out or open the site in Incognito Mode.\n\n&nbsp;\n\nTitle and description you can change in <strong>Appearance → Widgets</strong>. Find  <strong>Comingsoon</strong> sidebar and change the widget on it. You can also publish different type of widgets if you like.', 'Coming soon', '', 'publish', 'closed', 'closed', '', 'coming-soon', '', '', '2015-09-22 10:10:40', '2015-09-22 10:10:40', '', 0, 'http://demo.pixelemu.com/pe-magnetic-watermark/?page_id=370', 0, 'page', '', 0);
