(379, 1, '2015-09-22 10:51:36', '2015-09-22 10:51:36', '<div class=\"embed-responsive embed-responsive-16by9\">[embed]https://www.youtube.com/watch?v=z9y-4wpVD0E&t=9s[/embed]</div>\n<h2 class=\"pe-typo-title\">Animated hover CSS3 effects for images</h2>\nThese shortcodes allows you to display an image and its description with animated CSS3 effect.\n<strong>Note:</strong> If you would like to add your own text into the image description, just modify the shortcode below or edit an existing shortcode of the demo template.\n<p><strong>Parameters</strong></p>\n<ul>\n<li>title</li>\n<li>subtitle</li>\n<li>effect : saddie / goliath / julia / marley</li>\n<li>background : URL to image with http://</li>\n<li>fontcolor : color value (HEX)</li>\n<li>width : size in PX</li>\n<li>height : size in PX</li>\n<li>link : URL with http://</li>\n<li>target : _self / _blank</li>\n</ul>\n<div class=\"row\"><div class=\"col-md-6\">\n<p><strong>Example 1</strong></p>\n[code][anibox effect=\"sadie\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"sadie\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 1\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div>\n<div class=\"col-md-6\">\n<p><strong>Example 2</strong></p>\n[code][anibox effect=\"goliath\" background=\"http://placehold.it/480x360\"  fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"goliath\" background=\"http://placehold.it/480x360\"  fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 2\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div></div>\n<div class=\"row\"><div class=\"col-md-6\">\n<p><strong>Example 3</strong></p>\n[code][anibox effect=\"julia\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"julia\" background=\"http://placehold.it/480x360\" fontcolor=\"#000000\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 3\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div>\n<div class=\"col-md-6\">\n<p><strong>Example 4</strong></p>\n[code][anibox effect=\"marley\" background=\"http://placehold.it/480x360\" fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title Alternative\" subtitle=\"Lorem ipsum dolor sit amet.\"][/code]\n<div style=\"margin: 0 auto 30px;\">[anibox effect=\"marley\" background=\"http://placehold.it/480x360\" fontcolor=\"#ffffff\" width=\"480\" height=\"360\" link=\"#\" title=\"Example Title 4\" subtitle=\"Lorem ipsum dolor sit amet.\"]</div></div></div>\n\n<h3 class=\"pe-typo-title\">Testimonial</h3>\n<p><strong>Parameters</strong></p>\n<ul>\n<li>title</li>\n<li>subtitle</li>\n<li>class : custom css class (eg. right)</li>\n</ul>\n<div class=\"row\"><div class=\"col-md-6\">\n[code][testimonial class=\"right\" title=\"bill gates\" subtitle=\"famous visionary\"] [i]Nunc at pellentesque...[/i] [/testimonial][/code]\n[testimonial class=\"right\" title=\"bill gates\" subtitle=\"famous visionary\"]Nunc at pellentesque massa, a euismod nisl. Sed quam diam, ultrices ac enim a, cursus gravida lorem. Etiam non suscipit massa. Proin condimentum tristique augue ac varius. Maecenas feugiat ex vitae massa viverra tincidunt et sed tellus. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia.[/testimonial]\n</div><div class=\"col-md-6\">\n[code style=\"min-height: 117px;\"][testimonial title=\"steven tyler\" subtitle=\"famous singer\"] [i]Nunc at pellentesque...[/i] [/testimonial][/code]\n[testimonial title=\"steven tyler\" subtitle=\"famous singer\"]Nunc at pellentesque massa, a euismod nisl. Sed quam diam, ultrices ac enim a, cursus gravida lorem. Etiam non suscipit massa. Proin condimentum tristique augue ac varius. Maecenas feugiat ex vitae massa viverra tincidunt et sed tellus. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia.[/testimonial]\n</div></div>\n\n<h3 class=\"pe-typo-title\">Video Gallery</h3>\n<p><strong>Parameters</strong></p>\n<ul>\n<li>id : ID of video</li>\n<li>web : youtube / vimeo</li>\n<li>fs : 1 / 0</li>\n<li>size : 1 - 12 (grid)</li>\n</ul>\n[code][row][pevideo id=\"Hq8SzbapPkA\" web=\"youtube\" fs=\"1\" size=\"4\"][pevideo id=\"74195893\" web=\"vimeo\" fs=\"1\" size=\"4\"][pevideo id=\"_XwrAefrCxc\" web=\"youtube\" fs=\"0\" size=\"4\"][/row][row][pevideo id=\"dtncYXTbjOk\" web=\"youtube\" fs=\"1\" size=\"6\"][pevideo id=\"hIhXtoyN_6A\" web=\"youtube\" fs=\"1\" size=\"6\"][/row][/code]\n<div class=\"clearfix\">[row][pevideo id=\"Hq8SzbapPkA\" web=\"youtube\" fs=\"1\" size=\"4\"][pevideo id=\"74195893\" web=\"vimeo\" fs=\"1\" size=\"4\"][pevideo id=\"_XwrAefrCxc\" web=\"youtube\" fs=\"0\" size=\"4\"][/row][row][pevideo id=\"dtncYXTbjOk\" web=\"youtube\" fs=\"1\" size=\"6\"][pevideo id=\"hIhXtoyN_6A\" web=\"youtube\" fs=\"1\" size=\"6\"][/row]</div>\n\n<h3 class=\"pe-typo-title\">Image Gallery</h3>\n<p><strong>Parameters</strong></p>\n<ul>\n<li>orderby : none / ID / author / title / date / modified / parent / rand / comment_count / menu_order / post__in</li>\n<li>order : ASC / DESC</li>\n<li>id : image ID</li>\n<li>columns : 1 - 12 (grid)</li>\n<li>size : full / medium / thumbnail (image size)</li>\n<li>link : URL with http://</li>\n<li>modal : enable / disable</li>\n</ul>\n[code][pegallery modal=\"enable\" size=\"full\" columns=\"3\" ids=\"2172, 2173, 2174, 2175, 2176, 2177\" orderby=\"rand\"][/code]\n<div class=\"clearfix\">[pegallery modal=\"enable\" size=\"full\" columns=